import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter,Route,Switch} from 'react-router-dom'

import FormPage from "./components/screens/Forms/FormPage"
import Success from "./components/Success";
import Cafepage from "./components/Cafepage" 
import Home from './components/Home/Home';
import Signup from './components/auth/Signup/Signup';
import Login from './components/auth/Login/Login';
import Cart from './components/screens/Cart/Cart';

import React from 'react';
//handles the routes
function App() {

  return(

<BrowserRouter>
  <Switch>
    <Route exact path="/">
      <Home/>
    </Route>
    <Route exact path="/addDetails">
    <FormPage/>
    </Route>
    <Route exact path="/success/:id">
      <Success/>
    </Route>
    <Route exact path="/cafepage/:id">
      <Cafepage/>
    </Route>
    <Route exact path="/login">
      <Login/>
    </Route>
    <Route exact path="/signup">
      <Signup/>
    </Route>
    <Route exact path="/cafepage/browse">
      <Cafepage/>
    </Route>
    <Route exact path="/cart">
      <Cart cart={[]}/>
    </Route>
  </Switch>
</BrowserRouter>
  )

}

export default App;
